    //// Variable Declarations
    UIColor* bombTextColour = [numBombs isEqualToString: @"0"] ? MineHuntImages.whiteColour : ([numBombs isEqualToString: @"1"] ? MineHuntImages.blackColour : ([numBombs isEqualToString: @"2"] ? MineHuntImages.blueColour : ([numBombs isEqualToString: @"3"] ? MineHuntImages.greenColour : ([numBombs isEqualToString: @"4"] ? MineHuntImages.yellowColour : MineHuntImages.redColour))));

    //// Symbol Drawing
    CGRect symbolRect = CGRectMake(CGRectGetMinX(frame) + floor(CGRectGetWidth(frame) * 0.00000 + 0.5), CGRectGetMinY(frame) + floor(CGRectGetHeight(frame) * 0.00000 + 0.5), floor(CGRectGetWidth(frame) * 1.00000 + 0.5) - floor(CGRectGetWidth(frame) * 0.00000 + 0.5), floor(CGRectGetHeight(frame) * 1.00000 + 0.5) - floor(CGRectGetHeight(frame) * 0.00000 + 0.5));
