    UIRectClip(symbolRect);
    CGContextTranslateCTM(context, symbolRect.origin.x, symbolRect.origin.y);

    [MineHuntImages drawEmptyWithFrame: CGRectMake(0, 0, symbolRect.size.width, symbolRect.size.height)];
    CGContextRestoreGState(context);


    //// Text Drawing
    CGRect textRect = CGRectMake(CGRectGetMinX(frame) + floor(CGRectGetWidth(frame) * 0.12500 + 0.5), CGRectGetMinY(frame) + floor(CGRectGetHeight(frame) * 0.10000 + 0.5), floor(CGRectGetWidth(frame) * 0.90000 + 0.5) - floor(CGRectGetWidth(frame) * 0.12500 + 0.5), floor(CGRectGetHeight(frame) * 0.87500 + 0.5) - floor(CGRectGetHeight(frame) * 0.10000 + 0.5));
