    [MineHuntImages.whiteColour setFill];
    [textPath fill];
    CGContextSaveGState(context);
    CGContextSetShadowWithColor(context, MineHuntImages.shadow.shadowOffset, MineHuntImages.shadow.shadowBlurRadius, [MineHuntImages.shadow.shadowColor CGColor]);
    NSMutableParagraphStyle* textStyle = NSMutableParagraphStyle.defaultParagraphStyle.mutableCopy;
    textStyle.alignment = NSTextAlignmentCenter;
    
    UILabel *label = [[UILabel alloc] initWithFrame:textRect];
    label.text = numBombs;
    float largestFontSize = 50;
    while ([label.text sizeWithAttributes:@{NSFontAttributeName:[UIFont systemFontOfSize:largestFontSize]}].width > textRect.size.width/2)
    {
        largestFontSize--;
    }
    //label.font = [UIFont systemFontOfSize:largestFontSize];
    NSLog(@"font size %f",largestFontSize);
    
    NSDictionary* textFontAttributes = @{NSFontAttributeName: [UIFont systemFontOfSize: largestFontSize], NSForegroundColorAttributeName: bombTextColour, NSParagraphStyleAttributeName: textStyle};
    
    CGFloat textTextHeight = [numBombs boundingRectWithSize: CGSizeMake(textRect.size.width, INFINITY)  options: NSStringDrawingUsesLineFragmentOrigin attributes: textFontAttributes context: nil].size.height;
    CGContextSaveGState(context);
    CGContextClipToRect(context, textRect);
    [numBombs drawInRect: CGRectMake(CGRectGetMinX(textRect), CGRectGetMinY(textRect) + (CGRectGetHeight(textRect) - textTextHeight) / 2, CGRectGetWidth(textRect), textTextHeight) withAttributes: textFontAttributes];
    CGContextRestoreGState(context);
    CGContextRestoreGState(context);
}

